% Define the base-3 to base-10 conversion function
function b3_to_b10 = b3_to_b10(b3_num)
    b3_num = str2num(b3_num);
    b6_num = dec2base(b3_num, 6);
    b10_num = dec2base(b6_num, 10);
    b3_to_b10 = b10_num(end);
end

% Define the base-6 to base-10 conversion function
function b6_to_b10 = b6_to_b10(b6_num)
    b6_num = str2num(b6_num);
    b10_num = dec2base(b6_num, 10);
    b6_to_b10 = b10_num;
end

% Define the number of digits in base-3 and base-6
num_digits_b3 = 4;
num_digits_b6 = 2;

% Initialize the counter for the number of solutions
num_solutions = 0;

% Loop through all possible base-3 numbers with 4 digits
for b3_num = '1000' : '2666'
    if num_digits_b3(end) == 1
        b3_num = '0' + b3_num;
    end

    % Check if the base-3 number has exactly 2 digits in base-6
    if num_digits_b6(b3_to_b10(b3_num)) == num_digits_b6
        num_solutions = num_solutions + 1;
    end
end

% Print the final answer
printf('%.0g\n', num_solutions);

