octave_code:
% Number of Republicans (R) and Democrats (D)
R = 8;
D = 6;

% Minimum number of members from each party
min_R = 1;
min_D = 1;

% Total number of members in the subcommittee
n = 5;

% Calculate the number of ways to form a subcommittee with at least one member from each party
total = 0;
for i = min_R:R
    for j = min_D:D
        total = total + combin(R, i) * combin(D, j) * (R - i) * (D - j) * factorial(n - i - j);
    end
end

% Print the final answer
fprintf('%d\n', total);

