octave_code:
% Initialize the digits vector
digits = [0, 0, 0, 0, 0];

% Initialize the factors vector
factors = zeros(5, 1);

% Initialize the permutations counter
counter = 0;

% Loop through all possible permutations of the digits
for i = 1:factorial(5)
    % Get the current permutation
    permutation = perms(digits);

    % Check if the permutation is unique
    if counter == i
        continue;
    end

    % Set the counter to the current permutation
    counter = i;

    % Loop through all digits
    for j = 1:5
        % Check if the current digit is zero
        if digits(j) == 0
            continue;
        end

        % Check if the current digit is a factor of the permutation
        if mod(permutation, digits(j)) ~= 0
            % If not, break the loop and move to the next permutation
            break;
        end

        % If the current digit is a factor, update the factors vector
        factors(j) = digits(j);
    end

    % If all digits are factors, check if the permutation is divisible by all its non-zero digits
    if all(factors ~= 1)
        % If it is, print the permutation
        printf('%.15g\n', permutation);

        % Check if the permutation is divisible by all its non-zero digits
        if all(mod(permutation, factors) == 0)
            % If it is, print the factors
            printf('Factors: %s\n', factors');
        end
    end

    % Reset the factors vector
    factors = zeros(5, 1);
end

