octave_code:
% Given data:
x = 1:inf;

% Unknowns:
% x

% Constraints:
% x > 0
% 1/(x^2 + x) is a terminating decimal

% Applicable methods:
% Check if 1/(x^2 + x) is a terminating decimal using the following function:
function terminating = is_terminating(n)
    digits = digits(n);
    unique_digits = unique(digits);
    terminating = length(unique_digits) == 1;
endfunction

% Initialize variables
min_x = inf;
second_min_x = inf;

% Iterate over x
for i = 1:length(x)
    if is_terminating(1./(x(i)^2 + x(i)))
        if x(i) < min_x
            second_min_x = min_x;
            min_x = x(i);
        elseif x(i) < second_min_x && x(i) != min_x
            second_min_x = x(i);
        endif
    endif
endfor

% Print the second smallest such integer
fprintf('%.15g\n', second_min_x);

