    if num_divisors(i) == 16 && all(ismember(given_data, factor(i)))
        fprintf('%d\n', i);
        break;
    end
end

function num_divisors(n)
    count = 0;
    for i = 1:sqrt(n)
        if is_power_of_two(i)
            count = count + 2 * floor(n / i);
        else
            count = count + (floor((n + i - 1) / i) + floor((n - 1) / (i * 2)));
        end
    end
    if sqrt(n)^2 == n
        count = count + 1;
    end
    return count;
end

function is_power_of_two(n)
    if n == 0
        return false;
    end
    if n & (n - 1) == 0
        return true;
    end
    return false;
end

