octave_code:
function prime_factors(n)
    if (n < 2)
        return [];
    endif

    primes = [2];
    sieve = ones(1, n+1);
    sieve(2:2:n) = 1;

    for i = 3:2:n
        if (sieve(i) == 1)
            primes = [primes; i];
            for j = i*i:2:n
                sieve(j) = 0;
            endfor
        endif
    endfor

    return primes;
endfunction

% Prime factorization of 20!
