% Define the permutation function
function perms = permutations(vec)
    n = length(vec);
    perms = zeros(n, factorial(n));
    for i = 1:n
        perms(i, 1) = vec;
    end
    for i = 2:n
        for j = 1:factorial(n - i + 1)
            for k = 1:n - i + 1
                perms(i, j) = [perms(i - 1, j)(k:k + i - 1), vec(i)];
            end
        end
    end
end

% Calculate the total number of permutations of the word
total_perms = factorial(length);

% Calculate the number of permutations that begin with a B
b_perms = 0;
for i = 1:length
    b_perms = b_perms + total_perms(i) * (length - i);
end

% Calculate the number of valid permutations
valid_perms = total_perms - b_perms;

% Print the final answer
fprintf('%d\n', valid_perms);

