% Given data
diameter_increase = 0.25;

% Unknowns
height_decrease = sym('h');

% Constraints
volume_constant = true;

% Applicable methods
% The volume of a cylinder is given by V = πr^2h, where r is the radius.
% Since the volume is constant, we can set up an equation to solve for the height decrease.

% Given that the diameter is increasing by 25%, the radius is also increasing by 25%.
radius_increase = diameter_increase / 2;

% The old radius is the current radius minus the increase.
old_radius = sym('r') - radius_increase;

% The new radius is the old radius plus the increase.
new_radius = old_radius + radius_increase;

% The old and new volumes are equal.
old_volume = pi * old_radius^2 * sym('h');
new_volume = pi * new_radius^2 * (sym('h') - height_decrease);

% Solve for the height decrease.
eq = old_volume - new_volume;
sol = solve(eq, height_decrease);

% Print the final answer
fprintf('%.15g\n', sol.height_decrease);

