Here's the GNU Octave script to generate the graph of $y = -f(x)$ and print the corresponding letter:

```octave
% Define the function f(x)
function y = f(x)
  if (x >= -3 && x <= 0) {y = -2 - x;}
  if (x >= 0 && x <= 2) {y = sqrt(4 - (x - 2)^2) - 2;}
  if (x >= 2 && x <= 3) {y = 2*(x - 2);}
endfunction

% Define the function g(x) = -f(x)
function y = g(x)
  y = -f(x);
endfunction

% Generate the graph of g(x)
