question:
Three semicircles of radius 1 are constructed on diameter $\overline{AB}$ of a semicircle of radius 2. The centers of the small semicircles divide $\overline{AB}$  into four line segments of equal length, as shown. What is the area of the shaded region that lies  within the large semicircle but outside the smaller semicircles? Express your answer in terms of $\pi$ and in simplest radical form.

[asy]
fill((0,2)..(2,0)--(-2,0)..cycle,gray(0.7));
fill((-1,1)..(0,0)--(-2,0)..cycle,white);
fill((1,1)..(0,0)--(2,0)..cycle,white);
fill((0,1)..(1,0)--(-1,0)..cycle,white);
draw((0,1)..(1,0)--(-1,0)..cycle,dashed);
draw((0,2)..(2,0)--(-2,0)..cycle);
label("$A$",(-2,0),W);
label("$B$",(2,0),E);
label("1",(-1.5,0),S);
label("2",(0,0),S);
label("1",(1.5,0),S);
dot((0,0));
dot((-1,0));
dot((1,0));
draw((-2,-0.1)--(-2,-0.4));
draw((-1,-0.1)--(-1,-0.4));
draw((2,-0.1)--(2,-0.4));
draw((1,-0.1)--(1,-0.4));
[/asy]

octave_code:
% Given data
r1 = 1;
r2 = 2;

% Unknowns
area = unknown('area');

% Constraints
% The area of the shaded region is the difference between the area of the large semicircle and the sum of the areas of the three small semicircles.
% The area of a semicircle is given by the formula A = (1/2) * pi * r^2.

% Applicable methods
% Calculate the area of the large semicircle and the three small semicircles, and subtract the sum of the areas of the small semicircles from the area of the large semicircle.

% Calculate the area of the large semicircle
large_semi_circle_area = (1/2) * pi * r2^2;

% Calculate the area of each small semicircle
small_semi_circle_area = (1/2) * pi * r1^2;

% Calculate the area of the shaded region
area = large_semi_circle_area - 3 * small_semi_circle_area;

% Print the final answer
fprintf('%.15g\n', area);

