dist_23 = 100;
dist_31 = dist_12 + dist_23 - 50;
trips_per_day = 3;
service_distance = 18000;

% Unknowns
dist_31_unknown = true;
days_unknown = true;

% Constraints
dist_31_constraint = dist_31 >= 0;

% Applicable methods
method = "algebraic_equation";

% If a unit of measurement is used, specify which one
unit = "miles";

% Solve the problem
if (dist_31_unknown)
    dist_31 = dist_31_constraint;
end

% Calculate the total distance
total_distance = dist_12 + dist_23 + dist_31;

% Calculate the number of days between services
