This script will solve the problem symbolically using the `symbolic` method in GNU Octave and print the final answer as a floating-point number. To convert the floating-point number to a common fraction, you can use the `rationalize` function:

```
% Convert the floating-point number to a common fraction
answer = rationalize(answer);

% Print the final answer
printf('%c\n', answer);
```

However, the `rationalize` function may not always produce the simplest common fraction. For a more accurate solution, you can use a more advanced method, such as the Euclidean algorithm, to find the greatest common divisor (GCD) and reduce the fraction to its simplest form. Here's an example implementation:

```
function [num, denom] = simplify_fraction(num, denom)
    gcd_num_denom = gcd(num, denom);
    num = num / gcd_num_denom;
    denom = denom / gcd_num_denom;

    if denom > 1
        quotient = floor(num);
        num = num - quotient;
        denom = denom / (quotient + 1);
        simplify_fraction(num, denom);
    end
end

% Use the simplify_fraction function to simplify the answer
[num, denom] = simplify_fraction(answer);

% Print the final answer
printf('%d/%d\n', num, denom);
```

This script will simplify the fraction to its simplest form before printing the final answer.

