function [coeffs, r] = rotate_parabola(coeffs)
    % Rotate a parabola about its vertex
    %
    % Input:
    %   coeffs - coefficients of the parabola in the form [a, b, c]
    %
    % Output:
    %   coeffs - coefficients of the rotated parabola in the form [a, b, c]
    %   r - rotation matrix

    a = coeffs(1);
    b = coeffs(2);
    c = coeffs(3);

    % Calculate the center of the parabola
    x_c = -b / (2 * a);
    y_c = c * x_c * x_c + b * x_c + a;

    % Calculate the rotation matrix
    r = [cosd(pi), -sind(pi), sind(pi) * x_c, cosd(pi) * x_c, 0, 0, -sind(pi) * y_c, cosd(pi) * y_c, 1];

    % Transform the coefficients
    coeffs = r * [a, b, c]';
end

