area_OAC = 0.5 * norm(C - A);
area_OBC = 0.5 * norm(B - C);

# Calculate the area of the parallelogram ABCD, where D is the projection of point C onto the plane of triangle OAB
AB = norm(B - A);
AD = sqrt((AB * AB) - (area_OAB * area_OAB));
area_ABCD = AB * AD;

