   drawcube(location[i]);
}


[/asy]

octave_code:
function answer = solve_cube_problem()
    # Given data
    num_cubes = 14;
    num_faces = 6;
    num_red_cubes = num_cubes;
    num_red_faces = num_cubes * num_faces - num_red_cubes;

    # Unknowns
    unknowns = num_red_cubes;

    # Constraints
    constraints = num_red_faces == 4 * num_red_cubes;

    # Applicable methods
    method = "combinatorics";

    # Solution
    for i = 1:num_cubes
        if i == 1
            num_red_cubes_temp = i;
        else
            num_red_cubes_temp = num_red_cubes_temp + num_red_cubes - i;
            if num_red_faces == 4 * num_red_cubes_temp
                num_red_cubes = i;
                break;
            endif
        endif
    endfor

    printf('%.15g\n', num_red_cubes);
endfunction

