function divisors = divisor_count(n)
    divisors = 1;
    for i = 1:sqrt(n)
        if n % i == 0
            divisors = divisors * (i + 1);
            if i != floor(n/i)
                divisors = divisors * floor(n/i);
            endif
        endif
    endfor
endfunction

n = 1;
while (2*n + 1)^2 < 28^2 && (3*n + 1)^2 < 30^2
