# Constraints
angle_P = 40;
angle_Q = 35;
angle_STR = theta;

# Applicable methods
# 1. Law of Sines
# 2. Law of Cosines

# Law of Sines
ST = sqrt((R(1) - S(1))^2 + (R(2) - S(2))^2);
SR = sqrt((S(1) - P(1))^2 + (S(2) - P(2))^2);
QR = sqrt((R(1) - Q(1))^2 + (R(2) - Q(2))^2);

sin_ST_over_SR = sin(angle_P) / sin(angle_STR);
sin_SR_over_QR = sin(angle_Q) / sin(180 - angle_STR);

if (abs(sin_ST_over_SR - sin_SR_over_QR) < 1e-10)
    sum_angles = 180 - angle_P - angle_Q;
else
    error('The problem cannot be solved using the Law of Sines.');
end

fprintf('The sum of the angles is %.15g\n', sum_angles);

