% Ellipse area computation

% Given data
a = 3;
b = sqrt(36 - 9*a^2);

% Unknowns
x = y = linspace(-a, a, 100);
[X, Y] = meshgrid(x, y);

% Constraints
Z = 9*X.^2 + Y.^2 - 36;

% Applicable methods
[solX, solY] = roots([9*X.^2 + Y.^2 - 36, 2*X.*Y]);
solX = solX(:);
solY = solY(:);

% Exclude solutions outside the defined range
solX = solX(abs(solX) <= a);
solY = solY(abs(solY) <= a);

% Calculate area
area = pi * b * a * sum(erf(b * sqrt(2) * abs(X)) * erf(b * sqrt(2) * abs(Y)) * (solX == X & solY == Y));

% Print the final answer
printf('%.15g\n', area);

