octave_code:
% Given data
grid_size = [3, 3];
num_beads = 9;
colors = ["P", "G", "R", "B", "Y", "O", "W", "C", "V"];
forbidden_pairs = [["P", "G"], ["P", "P"], ["G", "G"]];

% Unknowns
bead_positions = zeros(grid_size(1), grid_size(2), num_beads);

% Constraints
for i = 1:num_beads-1
    for j = i+1:num_beads
        if any(abs(bead_positions(i,:,:) - bead_positions(j,:,:)) < 2)
            error("The given problem cannot be solved programmatically.");
        endif
    endfor
endfor

% Applicable methods
% Use backtracking to place beads on the grid

% Initialize the grid with all positions available
bead_positions(:) = 0:num_beads-1;

% Function to check if a given position is valid
function valid = check_position(pos)
    for i = 1:num_beads-1
        for j = i+1:num_beads
            if any(abs(pos(i,:) - pos(j,:)) < 2)
                return false;
            endif
        endfor
    endfor
    return true;
endfunction

% Function to place beads on the grid
function place_beads(pos, n)
    if n == num_beads
        % Check if the solution is valid
        if all(check_position(pos))
            % Print the solution
            for i = 1:num_beads
                printf("%c ", colors(bead_positions(i,:,:)+1));
            endfor
            printf("\n");
        endif
    else
        for i = 1:grid_size(1)*grid_size(2)
            if bead_positions(i,:,n) == 0
                bead_positions(i,:,n) = pos(n,:);
                place_beads(pos, n+1);
                bead_positions(i,:,n) = 0;
            endif
        endfor
    endif
endfunction

% Start the backtracking process
place_beads(eye(grid_size(1))*grid_size(2), 1);

