tax_paid = 10000;

% Find the tax bracket that tax_paid falls into
bracket_index = find((tax_brackets(2:end) <= tax_paid) & (tax_paid < tax_brackets(3:end)), 1, 'first');

% Calculate the tax paid in the found bracket
tax_paid_in_bracket = tax_rates(bracket_index) * (tax_brackets(bracket_index+1) - tax_brackets(bracket_index));

% Calculate the total tax paid
total_tax_paid = tax_paid - sum(tax_paid_in_bracket);

% Solve for the income in the last tax bracket
income = (total_tax_paid + sum(tax_paid_in_bracket)) / tax_rates(end);

% Print the final answer
printf('%.15g\n', income);

