% Define the tax brackets and rates
tax_brackets = [0, 20000, 25000, 60000, 100000, inf];
tax_rates = [0, 0, 0.05, 0.1, 0.15, 0.2];

% Define the tax paid
tax_paid = 10000;

% Loop through the tax brackets and calculate the tax paid in each bracket
tax_paid_in_bracket = zeros(length(tax_rates), 1);
for i = 1:length(tax_brackets)-1
    tax_paid_in_bracket(i) = tax_rates(i) * (tax_brackets(i+1) - tax_brackets(i));
end

% Calculate the total tax paid
total_tax_paid = tax_paid - sum(tax_paid_in_bracket);

% Solve for the income in the last tax bracket
income = (total_tax_paid + sum(tax_paid_in_bracket)) / tax_rates(end);

% Print the final answer
printf('%.15g\n', income);
```

