% Define the number of teams to be selected each day
n_selected = 2;

% Define the number of ways to select two teams out of three
n_combinations = factorial(n_teams) / (factorial(n_selected) * factorial(n_teams - n_selected));

% Define the total number of ways to select two teams out of three for each day
total_combinations = n_combinations^n_days;

% Define the number of ways to select Team A on at least two days
ways_team_a_selected = total_combinations - (factorial(n_teams - 1) * n_combinations^(n_days - 1));

% Calculate the probability
probability = ways_team_a_selected / total_combinations;

% Print the answer
printf('%.15g\n', probability)

