octave_code:
# Given data
A = [0, 0];
B = [0, 50];
C = [50, 50];
D = [50, 0];
E = [30, 50];
side_length = 10;
area_triangle_ABE = 40;

# Unknowns
BE = [0, 0];

# Constraints
AB = norm(B - A);
BC = norm(C - B);
CD = norm(D - C);
AD = norm(D - A);

# Applicable methods
# 1. Find the area of square ABCD and subtract the area of triangle ABE to find the area of square ABEF.
# 2. Find the area of square ABEF and divide it by 2 to find the area of triangle ABE.
# 3. Use the formula for the area of a triangle to find the area of triangle ABE and then solve for BE.

# Method 3
# Area of triangle ABE
semi_perimeter_ABE = (AB + BC + norm(E - A)) / 2;
area_triangle_ABE = sqrt(semi_perimeter_ABE * (semi_perimeter_ABE - AB) * (semi_perimeter_ABE - BC) * (semi_perimeter_ABE - norm(E - A)));

# Solve for BE
BE_x = E(1) - side_length * (area_triangle_ABE / area_triangle_ABE - 1);
BE_y = E(2);
BE = [BE_x, BE_y];

# Print the final answer
printf('%.15g\n', BE(1));

