In circle $J$, $HO$ and $HN$ are tangent to the circle at $O$ and $N$. Find the number of degrees in the sum of $m\angle J$ and $m\angle H$. [asy]
size(150);
import graph;
pair J = (0,0), H = (6,0), O, N;
path circ = Circle(J,3);
pair M = midpoint(J--H);
path secCirc = Circle(M,3);
pair[] tangentPoints = intersectionpoints(circ,secCirc);
O = tangentPoints[0]; N = tangentPoints[1];
draw(J--N--H--O--cycle);
draw(circ);
label("$H$",H,E);
label("$J$",J,W);
label("$N$",N,S);
label("$O$",O,NE);
[/asy]

octave_code:
# Importing necessary functions
distance_sq = @(a, b) sum((a - b).^2);

# Given data
J = [0, 0];
H = [6, 0];
R = 3;

# Unknowns
O = [NaN, NaN];
N = [NaN, NaN];

# Constraints
constraints = @(x) distance_sq(J, x) - R^2 <= 0 & distance_sq(H, x) - R^2 <= 0 & distance_sq(O, N) - R^2 <= 0;

# Applicable methods
method = 'least_squares';

# Solving the problem
[O, N] = minimize(fun @(x) distance_sq(J, x) + distance_sq(H, x), [O, N], method, constraints);

# Calculating the sum of angles
m_angle_J = acos((O(1)^2 + O(2)^2 - R^2) / (2 * O(1) * O(2))) * 180 / pi;
m_angle_H = acos((N(1)^2 + N(2)^2 - R^2) / (2 * N(1) * N(2))) * 180 / pi;
sum_of_angles = m_angle_J + m_angle_H;

# Printing the answer
fprintf('%.15g\n', sum_of_angles);

