function b = my_fzero(f, x0)
    % This is a simple implementation of the fzero function
    % using the bisection method.
    if (f(x0) * f(2*x0) >= 0)
        error('fzero: x0 does not bracket a zero of f');
    end
    a = x0;
    b = 2*x0;
    while abs(b - a) > 1e-14 * abs(b)
        c = (a + b) / 2;
        if f(c) * f(a) < 0
            b = c;
        else
            a = c;
        end
    end
    b = c;
end

