octave_code:
function paths = paths_from_A_to_B(w, h)
    grid = zeros(h, w);
    grid(1, 1) = 1;
    for i = 1:w-1
        for j = 1:h
            grid(j, i+1) = grid(j, i) + grid(j-1, i);
        end
    end
    for j = 1:h-1
        for i = 1:w
            grid(j+1, i) = grid(j+1, i) + grid(j, i);
        end
    end
    paths = grid(end, end);
end

w = 6;
h = 3;
printf('%.15g\n', paths_from_A_to_B(w, h));

